    <script>
        class CLink {
            constructor(link)
            {
                this.link = link;
                this.url = this.link.attr('href');
                this.method = (this.link.attr('link-method') ?? 'GET').toUpperCase();
            }

            init() {
                this.applyEvents();
            }

            applyEvents() {
                var _this = this;

                if (this.method !== 'GET') {
                    this.link.on('click', function(e) {
                        e.preventDefault();

                        var form = jQuery('<form>', {
                            'action': _this.url,
                            'method': 'POST'
                        });
                        form.append(jQuery('<input>', {
                            'name': '_token',
                            'value': '{{ csrf_token() }}',
                            'type': 'hidden'
                        }));
                        form.append(jQuery('<input>', {
                            'name': '_method',
                            'value': _this.method,
                            'type': 'hidden'
                        }));
                        $(document.body).append(form);
                        form.submit();
                    });
                        
                }
            }
        }

        $(function() {
            $('[link-method]').each(function() {
                var link = new CLink($(this));
                link.init();
            });
        });
    </script>
@endsection